window.bookSummaryJSON = "<p>Maulkin didn't know dying would mean a new eternity of dungeon delving, monster slaying, and glory hunting. If he had, he wouldn't have been so worried about kicking the bucket on a date gone even more wrong than usual.&nbsp;</p> <p>Reborn in the wild world of Amaranth, Maulkin finds himself in a hulking demi-human body with a sword of a size to match. Marked as an Eternal, a fledging immortal of boundless potential, Maulkin soon discovers he's been given a mission by the elder pantheon of this new realm:&nbsp;</p> <p>Grow stronger. Ascend to godhood. Spread chaos in their name.&nbsp;</p> <p>Oh and fend off that inbound apocalypse, if he can find the time.&nbsp;</p> <p>Who wants an easy afterlife anyway?</p>"; 
